import { findModuleChild } from '../webpack';
export const Marquee = findModuleChild((m) => {
    if (typeof m !== 'object')
        return;
    for (const prop in m) {
        if (m[prop]?.toString && m[prop].toString().includes('.Marquee') && m[prop].toString().includes('--fade-length')) {
            return m[prop];
        }
    }
    return;
});
